import React, { useContext } from 'react'
import { useParams } from 'react-router-dom'
import { RestContext } from '../context/RestContext'

const Details = () => {
  const {id} = useParams
  const {restReview, setRestReview} = useContext(RestContext)
  return (
    <div>
      Details
    </div>
  )
}

export default Details;
